import { SplideSlide } from "@splidejs/react-splide";
import Button from "../../Button";

const Learn_Slide = ({
  title,
  subtitle,
  image,
  alt,
  link1,
  link1_label,
  link2,
  link2_label,
}) => {
  return (
    <SplideSlide>
      <section className="fullSection"></section>
    </SplideSlide>
  );
};

export default Learn_Slide;
